import React from 'react'

import hair1 from '../../../images/hair/hair1.svg';
import hair2 from '../../../images/hair/hair2.svg';
import hair3 from '../../../images/hair/hair3.svg';
import hair4 from '../../../images/hair/hair4.svg';
import hair5 from '../../../images/hair/hair5.svg';
import hair6 from '../../../images/hair/hair6.svg';
import hair7 from '../../../images/hair/hair7.svg';

const RightElementHair = () => {
    return (
        <div className="right_element element-hair">
            <img className="right_image" id="element_12" src={hair1} alt="hair1"></img>
            <img className="right_image" id="element_13" src={hair2} alt="hair2"></img>
            <img className="right_image" id="element_14" src={hair3} alt="hair3"></img>
            <img className="right_image" id="element_15" src={hair4} alt="hair4"></img>
            <img className="right_image" id="element_16" src={hair5} alt="hair5"></img>
            <img className="right_image" id="element_17" src={hair6} alt="hair6"></img>
            <img className="right_image" id="element_18" src={hair7} alt="hair7"></img>
        </div>
    )
}

export default RightElementHair
